    def renamne(self):
        filepath = self.lineEdit_wt1_1.text()
        newname = self.lineEdit_wt1_2.text()

        if not os.path.exists(filepath):
            self.textEdit_w1_1.append('该文件不存在:{}'.format(filepath))
